import { useState } from "react";
export default function Today() {
  const [pageNum, setPageNum] = useState(1);
  const [numPages, setNumPages] = useState(null);
  function onDocumentSuccess({ numPages }) {
    setNumPages(numPages);
  }
  console.log(pdfFile);
  return <div></div>;
}
